Meet Malena! She wrote the first draft of the lyrics of Leleyo and really helped set the tone. She produced all the vocals and we also added a gazillion layers of her voice to create the song’s mystical & nocturnal setting. ✨🌘🌿🔹

@malenamarcase 

#teamleleyo

These gorgeous ones don’t need introductions! 

@boblanzetti laid down numerous guitar parts to create the forest cosmos including that big slide in the beginning. I think I had asked if something along the lines of “A sound of a rabbit leaping in slow motion”, was possible. 

@aronoffmatt if you isolate his bass part, you would be amazed - he can locate every nook and cranny of the rhythm grid of a song. 

@justinmstanton built the dreamy Rhodes / synth world of Leleyo and also contributed in lyrics and vocal tracking. You can hear his mellifluous voice from the 2nd chorus and on. 

There is one person from the band missing from this New York subway picture - I’ll tell you all about him tomorrow. 

